import Logo from "./Logo"


const Header=()=>{

    return(
      <nav className='bg-gray-800 border-gray-800 px-10'>
         <div className="container flex flex-wrap justify-between items-center mx-auto">
             <Logo logo='https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.easy-plain-accessible.com%2Fwp-content%2Fuploads%2Flogo-01-corona-4912186-1280.png&imgrefurl=https%3A%2F%2Fwww.easy-plain-accessible.com%2Fcorona-information-in-easy-german%2F&tbnid=zbDDDW6LkJjxrM&vet=12ahUKEwiQ4_-I44n5AhUHKewKHbU7BWsQMyhZegQIARB9..i&docid=7RnOyXcHw7KWZM&w=490&h=490&q=corona%20logo&ved=2ahUKEwiQ4_-I44n5AhUHKewKHbU7BWsQMyhZegQIARB9'  />
         </div>
      </nav>
    )
}

export default Header
